    {
        id: 1,
        text: 'Doctors Appointment',
        day: 'Feb 5th at 2:30pm',
        remainder: true
    },
    {
        id: 2,
        text: 'Meeting at school',
        day: 'Feb 5th at 2:30pm',
        remainder: true
    },
    {
        id: 3,
        text: 'Food Shopping',
        day: 'Feb 5th at 2:30pm',
        remainder: false
    }
]

const Tasks = () => {
  return (
    <div>
        <h1>he</h1>
      {tasks.map((task) => {
        <h3 key={task.id}>{task.text}</h3>
      })}
    </div>
  )
}

export default Tasks
